import React from 'react'
import NSMenuItem from '../components/NSMenuItem/index'

export default {
  title: 'New Story Menu Item',
  component: NSMenuItem
}

export function MenuItemContainer() {

  return (
    <div>
      <h3>Menu Item</h3>
    </div>
  )
}
